import './App.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from './Home';
import Navbar from './Navbar';
import Signup from './Signup';
function App() {
return (
 <div>
  <Router>
    <Navbar />
    <Routes>
      <Route path="/Home" element={<Home />} />
      <Route path="/Signup" element={<Signup />}/>
      </Routes> 
  </Router>
 </div>
  );
}

export default App;
